Description of 
holotype
.

Adult male, SVL 
81.5 mm
(Plate 
1
A). Head moderately long (HeadL/SVL: 
0.28
), narrow (HeadW/HeadL: 
0.67
), depressed (HeadH/HeadL: 
0.38
), distinct from neck; lores and interorbital region inflated, canthus rostralis absent, frontonasal region concave; snout elongate (SnEye/ HeadL: 
0.38
), pointed, longer than eye diameter (OrbD/SnEye: 
0.70
); scales on snout small, rounded, granular, homogeneous, larger than those on occipital region. Eye large (OrbD/HeadL: 
0.37
), pupils dark blue with red crenelated margins; supraciliaries short, bearing tiny conical spines posteriorly. Ear opening oval, oblique, small (EarL/HeadL: 
0.09
); eye to ear distance greater than diameter of eye (EyeEar/OrbD: 
1.03
). Rostral scales smooth, incompletely divided posteriorly by a shallow dorsal groove; two enlarged supranasals in broad contact with three smaller intersupranasals (Plate 
2
A); rostral in contact with first supralabial and nostril; nostril oval, surrounded by supranasal, rostral, first supralabial, and three enlarged postnasals; 
2–3
rows of small scales separate orbit from supralabials. Mental triangular, wider (
2.7 mm
) than deep (
2.1 mm
); one pair of enlarged postmentals, in broad contact medially, bordered anteromedially by mental, bordered anterolaterally by first infralabial, posterolaterally by four enlarged lateral chinshields (Plate 
2
B). 
11
(R and L) infralabials; 
18
interorbital scale rows across the frontal bone; 
27
scales between eye and nostril.
